import {
  faChampagneGlasses,
  faSquare,
  faBurger,
  faGlassWater,
  faArrowDownLong,
  faArrowUpLong,
  faBriefcase,
  faCommentDollar,
  faSackDollar,
} from "@fortawesome/free-solid-svg-icons";

export const itemList = [
  {
    icons: [faSquare, faChampagneGlasses],
    data: {
      title: "Food & Drink",
      date: new Dat("2022-08-24").toLocalDateString(),
    },
    money: {
      amount: 20,
      income: false,
      // ingreso true, gasto false
    },
  },
];

export const classes = {
  incoming: {
    bgColor: "light-incoming",
    color: "incoming",
  },
  transfer: {
    bgColor: "light-transfer",
    color: "transfer",
  },
};
